import React, { useEffect, useState } from "react";
import Form from "./Form"

function App(){

    const [backEndData, setBackendData] = useState([{}])

    useEffect(() => {
        fetch("/validate").then(
            response => response.json()
        ).then(
            data => {
                setBackendData(data)
            }
        )
    }, [])

    return (
        <div>
            <Form />
            {backEndData.message.map((me, i) => {
                <p key={i}>{me}</p>
            })}
        </div>
    )

}

export default App
